【正例】 pub struct S { first: First, second: Second,
} impl S { // 不建议 `get_first`。 pub fn first(&self) -> &First { &self.first } // 不建议 `get_first_mut`, `get_mut_first`, or `mut_first`. pub fn first_mut(&mut self) -> &mut First { &mut self.first }
} 【反例】 pub struct S { first: First, second: Second,
} impl S { // 不符合：访问成员函数名字不用get_前缀。 pub fn get_first(&self) -> &First { &self.first } // 不符合： // 同样不建议 `get_mut_first`, or `mut_first`. pub fn get_first_mut(&mut self) -> &mut First { &mut self.first }
} 【例外】 但也存在例外情况：只有当有一个明显的东西可以通过getter得到时，才会使用get命名。例如，Cell::get可以访问一个Cell的内容。 对于进行运行时验证的getter，例如边界检查，可以考虑添加一个 Unsafe 的_unchecked 配套方法。一般来说，会有以下签名。 // 进行一些运行时验证，例如边界检查
fn get(&self, index: K) -> Option<&V>;
fn get_mut(&mut self, index: K) -> Option<&mut V>;
// 没有运行时验证，用于在某些情况下提升性能。比如，在当前运行环境中不可能发生越界的情况。
unsafe fn get_unchecked(&self, index: K) -> &V;
unsafe fn get_unchecked_mut(&mut self, index: K) -> &mut V; getter 和类型转换 (G.NAM.02) 之间的区别很小，大部分时候不那么清晰可辨。比如 TempDir::path 可以被理解为临时目录的文件系统路径的 getter ，而 TempDir::into_path 负责把删除临时目录时转换的数据传给调用者。 因为 path 方法是一个 getter ，如果用 get_path 或者 as_path 就不对了。 来自标准库的例子： std::io::Cursor::get_mut std::ptr::Unique::get_mut std::sync::PoisonError::get_mut std::sync::atomic::AtomicBool::get_mut std::collections::hash_map::OccupiedEntry::get_mut <[T]>::get_unchecked

