应该总是在项目中添加 rustfmt.toml 文件，即使它是空文件。这是向潜在的合作者表明你希望代码是自动格式化的。 在特殊的情况下，可以通过条件编译属性 #[cfg_attr(rustfmt, rustfmt_skip)] 或 #[rustfmt::skip] 来关闭自动格式化。 比如下面示例： vec! 中的元素排布是固定格式，这样有助于开发的便利。 fn main() { let got = vec![ 0x00, 0x05, 0x01, 0x00, 0xff, 0x00, 0x00, 0x01, 0x0c, 0x02, 0x00, 0xde, 0xad, 0xbe, 0xef, 0xde, 0xad, 0xbe, 0xef, b'd', b'e', b'a', b'd', b'b', b'e', b'e', b'f', 0x00, 0x00, 127, 0x06, 0x03, 0x00, 0x01, 0x02, b'a', b'b', b'c', b'd', 0x00, b'1', b'2', b'3', b'4', 0x00, 0x00, ];
} 如果使用 自动格式化，会变成： fn main() { let got = vec![ 0x00, 0x05, 0x01, 0x00, 0xff, 0x00, 0x00, 0x01, 0x0c, 0x02, 0x00, 0xde, 0xad, 0xbe, 0xef, 0xde, 0xad, 0xbe, 0xef, b'd', b'e', b'a', b'd', b'b', b'e', b'e', b'f', 0x00, 0x00, 127, 0x06, 0x03, 0x00, 0x01, 0x02, b'a', b'b', b'c', b'd', 0x00, b'1', b'2', b'3', b'4', 0x00, 0x00, ];
} 但是加上 #[rustfmt::skip] 就不会被自动格式化影响： fn main() { #[rustfmt::skip] let got = vec![ 0x00, 0x05, 0x01, 0x00, 0xff, 0x00, 0x00, 0x01, 0x0c, 0x02, 0x00, 0xde, 0xad, 0xbe, 0xef, 0xde, 0xad, 0xbe, 0xef, b'd', b'e', b'a', b'd', b'b', b'e', b'e', b'f', 0x00, 0x00, 127, 0x06, 0x03, 0x00, 0x01, 0x02, b'a', b'b', b'c', b'd', 0x00, b'1', b'2', b'3', b'4', 0x00, 0x00, ];
}
